import './App.css';
import Navbar from './components/Navbar';
import 'bootstrap/dist/css/bootstrap.min.css'
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from './pages/Home';
import About from './pages/About';
import Farmer from './pages/Farmer';
import Profile from './pages/Profile';
import FarmerEdit from './pages/FarmerEdit';
import ActivityEdit from './pages/ActivityEdit';
import AssetEdit from './pages/AssetEdit';
import PeopleEdit from './pages/PeopleEdit';
import MaterialConsumedEdit from './pages/MaterialConsumedEdit';


function App() {
  return (
    <div>
     <Navbar/>

     <Router>
          <Routes>
            <Route path='/' exact={true} element={<Home/>}/>
            <Route path='about' exact={true} element={<About/>}/>
            <Route path='farmer' element={<Farmer/>}/>
            <Route path='farmer/:id' element={<FarmerEdit/>}/>
            <Route path='farmerProfile/:id' element={<Profile/>}/>
            <Route path='activity/add/:id' element={<ActivityEdit/>}/>
            <Route path='activity/asset/add/:id' element={<AssetEdit/>}/>
            <Route path='activity/apeople/add/:id' element={<PeopleEdit/>}/>
            <Route path='activity/materialConsumed/add/:id' element={<MaterialConsumedEdit/>}/>
            </Routes>
        </Router>
    </div>
  );
}

export default App;
